import React, { useEffect } from "react";
import { getAllHippos } from "../controllers/getAllHippo";

const HippoCentral = () => {
  useEffect(() => {
    getAllHippos()
      .then((res) => {
        console.log("success", res);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return <div>HIPPO!</div>;
};

export default HippoCentral;
